DROP TABLE IF EXISTS `auto_series`;
CREATE TABLE `auto_series` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '车系名称',
  `short_name` varchar(255) NOT NULL DEFAULT '' COMMENT '车系短名称',
  `pinyin` varchar(255) NOT NULL DEFAULT '' COMMENT '拼音',
  `brand_pinyin` varchar(255) NOT NULL DEFAULT '' COMMENT '品牌拼音',
  `brand_id` int(10) NOT NULL DEFAULT '0' COMMENT '品牌id',
  `brand_name` varchar(255) NOT NULL DEFAULT '',
  `subbrand_id` int(10) NOT NULL DEFAULT '0' COMMENT '子品牌id',
  `subbrand_name` varchar(255) NOT NULL DEFAULT '' COMMENT '子品牌名',
  `auto_type` varchar(255) DEFAULT NULL COMMENT '车型级别，A00微型车/A0小型车，A紧凑型车，B中型车，C高级车，D豪华车，SUP跑车，SUVSUV，MPVMPV，PK 皮卡，MB 微面，SY 商用车',
  `apperance` float DEFAULT '0' COMMENT '外观评分',
  `average_score` float DEFAULT '0' COMMENT '综合评分',
  `cost_efficient` float DEFAULT '0' COMMENT '性价比评分',
  `internal` float DEFAULT '0' COMMENT '内饰评分',
  `maneuverability` float DEFAULT '0' COMMENT '操控性评分',
  `oil_consumption` float DEFAULT '0' COMMENT '油耗评分',
  `power` float DEFAULT '0' COMMENT '动力评分',
  `space` float DEFAULT '0' COMMENT '空间评分',
  `comfortableness` float DEFAULT '0' COMMENT '舒适性评分',
  `oil_consumption_info` varchar(1024) NOT NULL DEFAULT '' COMMENT '油耗信息',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片url',
  PRIMARY KEY (`id`),
  KEY `brand_id` (`brand_id`)
) ENGINE=MyISAM AUTO_INCREMENT=100024 DEFAULT CHARSET=utf8;

